import React from "react";

const Date = () => {
  const current = new Date();
  const date = `${current.getDate()}/${current.getMonth()+1}/${current.getFullYear()}`;
  // const month = date.getMonth() + 1;
  // const year = date.getFullYear();
  // const date_p = `${day}/${month}/${year}`;


  return (
    <div className="date">
      <p>{date}</p>
    </div>

  );
};

export default Date;
